import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M12 8a2 2 0 110-4 2 2 0 010 4z", fill: primaryFill }),
        React.createElement("path", { d: "M12 14a2 2 0 110-4 2 2 0 010 4z", fill: primaryFill }),
        React.createElement("path", { d: "M10 18a2 2 0 104 0 2 2 0 00-4 0z", fill: primaryFill }));
};
const MoreVertical24Filled = wrapIcon(rawSvg({}), 'MoreVertical24Filled');
export default MoreVertical24Filled;
